// mockCoachesData.js
const mockCoaches = [
    {
      id: 1,
      name: "Coach John",
      availability: "Weekdays",
      cost: 50,
      location: "New York",
      goal: "Weight Loss"
    },
    {
        id: 1,
        name: "Coach Mike",
        availability: "Monday",
        cost: 100,
        location: "New Jersey",
        goal: "Musseles Gain"
      },
  ];
  
  export default mockCoaches;
